angular.module("application.templates",[]).run(["$templateCache",function(n){n.put("login.html",'<md-list flex ng-controller="TodoController">\r\n    <md-subheader class="md-no-sticky">{{ \'title_menu\' | translate }}</md-subheader>\r\n    <md-list-item ng-click="userManagement()">\r\n        <md-icon>people</md-icon>\r\n        <p>{{ \'title_user_management\' | translate }}</p>\r\n    </md-list-item>\r\n</md-list>'),n.put("todo/todo.html",'<md-content flex layout="row" md-swipe-left="close()" md-swipe-right="menu()" md-theme="{{ theme }}">\r\n    <md-sidenav class="md-sidenav-left md-whiteframe-z2" md-component-id="menu" md-is-locked-open="$mdMedia(\'gt-md\')">\r\n        <ng-include src="\'login.html\'"></ng-include>\r\n    </md-sidenav>\r\n\r\n    <md-content flex layout="column">\r\n        <md-toolbar class="md-whiteframe-z2" md-scroll-shrink>\r\n            <div class="md-toolbar-tools" ng-if="theme == \'red\'">\r\n                <md-button class="md-icon-button" hide-gt-md ng-click="menu()">\r\n                    <md-tooltip>{{ \'action_menu\' | translate }}</md-tooltip>\r\n                    <md-icon>menu</md-icon>\r\n                </md-button>\r\n                <h2 class="md-title">{{ \'title_client_management\' | translate }}</h2>\r\n                <span flex></span>\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'white\'">\r\n                    <md-tooltip>{{ \'action_search\' | translate }}</md-tooltip>\r\n                    <md-icon>search</md-icon>\r\n                </md-button>\r\n                <md-button class="md-icon-button" ng-click="create()">\r\n                    <md-tooltip>{{ \'action_create_client\' | translate }}</md-tooltip>\r\n                    <md-icon>add</md-icon>\r\n                </md-button>\r\n            </div>\r\n\r\n            <div class="md-toolbar-tools" ng-if="theme == \'white\'">\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'red\'">\r\n                    <md-tooltip>{{ \'action_back\' | translate }}</md-tooltip>\r\n                    <md-icon>arrow_back</md-icon>\r\n                </md-button>\r\n                <md-input-container flex md-no-float>\r\n                    <br>\r\n                    <input ng-model="$parent.query.$" placeholder="{{ \'action_search\' | translate }}" type="search">\r\n                </md-input-container>\r\n                <md-button class="md-icon-button" ng-click="reset()">\r\n                    <md-tooltip>{{ \'action_reset\' | translate }}</md-tooltip>\r\n                    <md-icon>cancel</md-icon>\r\n                </md-button>\r\n            </div>\r\n        </md-toolbar>\r\n\r\n        <md-list flex md-virtual-repeat-container>\r\n            <md-subheader class="md-no-sticky">{{ \'title_record_count\' | translate:data }}</md-subheader>\r\n            <md-list-item class="md-2-line" md-virtual-repeat="username in data = (users | filter:query:regex | orderBy:\'username\')" ng-click="read(client)">\r\n                <md-icon>vpn_key</md-icon>\r\n                <div class="md-list-item-text">\r\n                    <h3 md-highlight-text="query.$" md-highlight-flags="gi">\r\n                        {{ username }}\r\n                    </h3>\r\n                    <p md-highlight-text="query.$" md-highlight-flags="gi">\r\n                        {{ user.id }}\r\n                    </p>\r\n                </div>\r\n                <md-menu md-position-mode="target-right target">\r\n                    <md-button aria-label="{{ \'action_more\' | translate }}" class="md-icon-button" ng-click="$mdOpenMenu($event)">\r\n                        <md-tooltip>{{ \'action_more\' | translate }}</md-tooltip>\r\n                        <md-icon>more_vert</md-icon>\r\n                    </md-button>\r\n                    <md-menu-content width="4">\r\n                        <md-menu-item>\r\n                            <md-button ng-click="update(client)">\r\n                                <md-icon>edit</md-icon>\r\n                                {{ \'action_update\' | translate }}\r\n                            </md-button>\r\n                        </md-menu-item>\r\n                        <md-menu-item>\r\n                            <md-button ng-click="delete($event, client)">\r\n                                <md-icon>delete</md-icon>\r\n                                {{ \'action_delete\' | translate }}\r\n                            </md-button>\r\n                        </md-menu-item>\r\n                    </md-menu-content>\r\n                </md-menu>\r\n            </md-list-item>\r\n        </md-list>\r\n    </md-content>\r\n</md-content>')}]);